import React from 'react';
import catagoryFullinfos from './catagoryFullinfos';
imp
import CatagoryCard from './catagoryCard'; // Capitalize component name

// If you're using makeStyles, define classes
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    catagory_container: {
        // Define your styles here
    },
}));

function Catagory() {
    const classes = useStyles(); // Define classes

    return (
        <section className={classes.catagory_container}>
            {catagoryFullinfos.map((infos) => (
                <CatagoryCard key={infos.title} data={infos} /> // Ensure you return the component
            ))}
        </section>
    );
}

export default Catagory;
